import React from 'react';
import { withRouter, Switch, Route, Redirect } from 'react-router-dom';
import { TransitionGroup, CSSTransition } from 'react-transition-group';
import HTML5Backend from 'react-dnd-html5-backend';
import { DragDropContext } from 'react-dnd';
import { createBrowserHistory } from 'history';
import { connect } from 'react-redux';
import Base from './components/Layout/Base';

import Home from './components/Home/Home';
import Documentation from './components/Documentation/Documentation';

// Logging
import ActivityLogs from './components/Logging/ActivityLogs';
import ActionLogs from './components/Logging/ActionLogs';
import AlertLogs from './components/Logging/Alerts/Alerts';
import AlertsAddEdit from './components/Logging/Alerts/AlertsAddEdit';
import LiveViewLogs from './components/Logging/LiveView';

// Schedule
import ScheduleOverview from './components/Schedule/Overview/Overview';
import ScheduleCalendar from './components/Schedule/Calendar/Calendar';
import ScheduleEditor from './components/Schedule/Editor/ScheduleEditor';

// Security
import SecurityUsers from './components/Security/Users/UsersContainer';
import AddEditUser from '/src/components/Security/Users/AddEditUser/AddEditUser';

import SecurityRoles from './components/Security/Roles/Roles';
import SecurityRolesAddEdit from './components/Security/Roles/AddEditRole';

// Settings
import SettingsSystem from './components/Settings/System/SystemSettings';
import SettingsUser from './components/Settings/UserSettings/UserSettings';
import SettingsPlatform from './components/Settings/Platform/Platform';
import SettingsModuleEditor from './components/Settings/Modules/ModuleEditor';

// Control Panels
import ControlPanels from './components/ControlPanels/ControlPanels';

const NoMatch = () => {
	return <h1>404 Not found</h1>;
};

let Routes = ({ location }) => {
	const currentKey = location.pathname.split('/')[1] || '/';
	const timeout = { enter: 500, exit: 500 };

	return (
		<Base>
			<div>
				<Switch location={location}>
					<Route exact path="/" component={Home} />
					<Route path="/home" component={Home} />

					{/* <Route component={NoMatch} /> */}
				</Switch>
			</div>
		</Base>
	);
};

export default withRouter(Routes);
